INSERT INTO `sp_报送层_10_借记卡信息表` VALUES ('借记卡信息表', '卡片状态', 'KPZT', 'V3', NULL, 'T3', 'CARD_STATE', 'ODS.SYM_CD_CARD_ARCH', '取自条件', 'CASE\n   WHEN T3.CARD_STATE = \'1\' THEN \'正常\'\n   WHEN T3.CARD_STATE IN(\'4\',\'5\', \'7\') THEN \'冻结\'\n   WHEN T3.CARD_STATE IN (\'11\', \'12\') THEN \'挂失\' --modify yujing 20191030 增加挂失状态\n   WHEN T3.CARD_STATE IN (\'3\', \'6\', \'9\') THEN \'注销\'\n   WHEN T3.CARD_STATE IN (\'2\', \'10\') THEN \'未激活\'\n   WHEN T3.CARD_STATE = \'8\' THEN \'其他-密码失效\'\n   WHEN (TO_DATE(V_DATA_DATE, \'YYYYMMDD\') -     TO_DATE(T1.LAST_TRAN_DATE, \'YYYYMMDD\') > 12 AND T1.ACTUAL_BAL < 10) OR     (TO_DATE(V_DATA_DATE, \'YYYYMMDD\') - TO_DATE(T3.ISS_DATE, \'YYYYMMDD\') > 12 AND     T1.LAST_TRAN_DATE IS NULL) THEN \'睡眠\'\n END AS KPZT', NULL, NULL, NULL, NULL, NULL, NULL);
